import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [users, setUsers] = useState([]);

  // Fetch users from the backend (Express API)
  useEffect(() => {
    axios.get('http://localhost:3005/users')  // Replace with your backend URL for users
      .then((response) => {
        setUsers(response.data);  // Store the response data (users)
      })
      .catch((error) => {
        console.error('There was an error fetching the users:', error);
      });
  }, []);  // Empty dependency array to run this once when the component mounts

  return (
    <div className="App">
    {/* Header with navigation bar */}
    <header className="App-header">
      <nav>
        <ul className="nav-links">
          <li><a href="/">Home</a></li>
          <li><a href="/about">About</a></li>
          <li><a href="/contact">Contact</a></li>
        </ul>
      </nav>
    </header>

    {/* Main content */}
    <div className="content">
      <h1>Users List</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Birth Year</th>
            <th>State</th>
            <th>Email</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user) => (
            <tr key={user.id}>
              <td>{user.id}</td>
              <td>{user.name}</td>
              <td>{user.birth_year}</td>
              <td>{user.state}</td>
              <td>{user.email}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  </div>
);
}

export default App;
